import Navigation from "./Navigation";
import Header from "./Header";
import ProductPage from "./ProductPage";
import { useState } from "react";



const Home = ()=>{
    const [cartItem, setCartItem]=useState(0)
    const increase = ()=>{
        setCartItem( cartItem + 1) ;
    }
    const decrease=()=>{
        if (cartItem > 0){
            setCartItem(cartItem - 1);
        }
    }

    return(
        <>
            <Navigation cartItem={cartItem} increase={increase} decrease={decrease}/>
            <Header />
            <ProductPage cartItem={cartItem} increase={increase} decrease={decrease}/>
        </>

    );
}

export default Home;
